Kendocup::Headline.create!([
  {title_fr: "Des invités de marques", title_en: "Prominent figures at the tournament", content_fr: "<p>L'année 2014 marque le trentième anniversaire de la création de la coupe Kasahara. A cette occasion, la Fédération Suisse de Kendo a invité le fils de Kasahara Toshiaki sensei: <b>KASAHARA Hirohaki sensei</b> à venir assister à la compétition.</p>\r\n<p>Agé de 63 ans,  7-Dan Kyoshi et pratiquant Nito comme son père, Kasahara Hirohaki sensei sera accompagné par deux autres figures importantes de la Fédération de Kendo de Shinagawa: <b>HAYASHI Hiromichi sensei</b>, 67 ans, 7-Dan Kyoshi et <b>SANO Eiichi sensei</b> (67 ans), 7-Dan Kyoshi.</p>\r\n<p>Nous nous réjouissons d'accueillir ces trois personnalités qui prendront part évidemment à l'arbitrage de la compétition mais aussi au Ji-Geiko du samedi soir.</p>", content_en: "<p>2014 marks the thirtieth anniversary of the creation of the Kasahara Cup in Switzerland. On this occasion, the Swiss Kendo Federation has invited the son of Kasahara Toshiaki sensei: <b>KASAHARA Hirohaki sensei</b> to assist to the competition.</p>\r\n<p>Now 63, 7-Dan Kyoshi and practicing Nito like his father, Kasahara Hirohaki sensei will be accompanied by two other important figures of the Shinagawa Kendo Federation: <b>HAYASHI Hiromichi sensei</b>, 67, 7-Dan Kyoshi and <b>SANO Eiichi sensei</b>, 67, 7-Dan Kyoshi.</p>\r\n<p>We are delighted to welcome these three personalities who will take part to the competition as referees, but also to Saturday night's Ji-Geiko.</p>", cup_id: 3, shown: true, title_de: nil, content_de: nil},
  {title_fr: "Les résultats en direct (ou presque)", title_en: "Get the results (almost) live", content_fr: "<p>Suivez-nous <a href=\"https://twitter.com/kendo_in_geneva\" href=\"_blank\">sur Twitter</a> pour avoir les derniers résultats</p>", content_en: "<p>Follow us <a href=\"https://twitter.com/kendo_in_geneva\" href=\"_blank\">on Twitter</a>, to get the latest results!</p>", cup_id: 3, shown: true, title_de: nil, content_de: nil},
  {title_fr: "30ème édition du tournoi", title_en: "30th edition of the tournament", content_fr: "Cette année est un peu spéciale car nous célébrons la 30ème édition de la coupe Kasahara. Pour fêter ça, le repas du samedi soir aura lieu au restaurant (oui madame!), à la Pizzeria de la Fontenette, pas loin de la salle ou se déroulera le tournoi 🍕🍝", content_en: "This year is a bit special as we celebrate the 30th edition of the Kasahara Cup. For this occasion, the Saturday dinner will be held at the “Pizzeria de la Fontenette”, not far from the competition hall 🍕🍝", cup_id: 5, shown: true, title_de: "", content_de: ""},
  {title_fr: "Fantastiques photos de Stéphane Cazalet", title_en: "Awesome pictures by Stéphane Cazalet", content_fr: "<p>Dimanche matin, Stéphane Cazalet était parmi nous avec son appareil.</p>\r\n<p>Ne manquez pas d'aller jeter un coup d'oeil <a href=\"https://www.flickr.com/photos/scazalet/sets/72157648154694195/\" target=\"_blank\">au résultat</a>!</p>", content_en: "<p>Sunday morning, Stéphane Cazalet was here with his camera.</ p> \r\n<p>You should go take a look at <a href=\"https://www.flickr.com/photos/scazalet/sets/72157648154694195/\" target=\"_blank\">his pictures</a>!</ p>", cup_id: 3, shown: true, title_de: nil, content_de: nil},
  {title_fr: "Les inscriptions sont ouvertes", title_en: "Registrations are open", content_fr: "Les inscriptions pour la 29ème édition de la Coupe Kasahara sont maintenant ouvertes. Nous espérons vous voir nombreux à Genève au mois de septembre.", content_en: "Registrations for the 29th Kasahara Cup are open. We hope to see many of you in Geneva next September!", cup_id: 4, shown: true, title_de: nil, content_de: nil}
])
